import React, { useEffect } from "react";
import { StyleSheet, View, Text, Button, FlatList } from "react-native";
import { useNavigation } from '@react-navigation/native';
import ItemCard from "./ItemCard";
import { ImageBackground } from "react-native";
import axios from "axios";
import { useDispatch, useSelector } from "react-redux";
import { AppAction } from "../redux/actions";
import { IAppState } from "../redux/store";

const image = { uri: 'https://belmontstudios.com/wp-content/uploads/marble-with-gold-gold-marble-by-blue-gold-marble-background-gold-marble-wallpaper-uk.jpg' };




const HomeScreen: React.FC<any> = (props: any) => {

  let temp: any = [];
  let tempStruct = {};

  const dispatch = useDispatch();
  useEffect(() => {grabMerchData()}, [])

  const body = useSelector((state: IAppState) => state.merchandise);

  const dummyData = [
    {
      id: 123,
      image: "data:image/jpeg;base64,",
      name: "Roswell, NM",
      price: 55
    },
    {
      id: 345,
      image: "data:image/jpeg;base64,",
      name: "Houston, TX",
      price: 49
    },
    {
      id: 678,
      image: "data:image/png;base64,",
      name: "The Jersiest of Jerseys",
      price: 35
    },
    {
      id: 919,
      image: "data:image/jpeg;base64,",
      name: "Vintage Pyramid Jersey",
      price: 39
    },
    {
      id: 239,
      image: "data:image/jpeg;base64,",
      name: "UFO Christmas",
      price: 25
    },
    {
      id: 300,
      image: "data:image/jpeg;base64,",
      name: "Official 2021 Tee",
      price: 37
    },
  ]

  const grabMerchData = async () => {
    await axios.get('https://wi6pqlczjk.execute-api.us-east-1.amazonaws.com/StageZero/merch')
      .then((response: any) => {
        let body = response.data;
        for(let i =0; i < body.length; i++){
          tempStruct = {
            id : parseInt(body[i].id),
            image : body[i].image,
            name : body[i].name,
            price : body[i].price
          }
          temp.push(tempStruct);
        }
        dispatch({
          type: AppAction.SET_MERCHANDISE,
          payload: {
            merchandise: temp
          }
        })
      })
  }

  const navigation = useNavigation<any>();

  return (

    <View style={styles.viewContainer}>
      <ImageBackground source={image} resizeMode="cover" style={{ justifyContent: 'center', flex: 1 }}
      >
        <Text style={styles.welcomeText}>Fashion Cubed</Text>
        <Text style={styles.hotStuff}>Summer Merch</Text>

        <FlatList
          data={body}
          renderItem={({ item }) => <ItemCard data={item}  > </ItemCard>}
        />


      </ImageBackground>
    </View>

  );
}
export default HomeScreen;

const styles = StyleSheet.create({
  viewContainer: {
    flex: 1,
    justifyContent: 'center'
  },
  welcomeText: {
    fontSize: 33,
    fontStyle: 'italic',
    fontFamily: 'sans-serif',
    paddingLeft: 19
  },
  hotStuff: {
    fontSize: 23,
    alignContent: 'stretch',
    fontStyle: 'normal',
    paddingLeft: 19
  },
  headerText: {
    fontSize: 28,
    fontStyle: 'italic',
  },
  outerMostView: {

  },
  headContainer: {
    alignItems: 'flex-start',
  }
})


